class Solution:
    def minImpossibleOR(self, nums: List[int]) -> int:
        s = set(nums)
        seen = set()
        for i in range(32):
            for j in range(i * 32, (i + 1) * 32):
                num = (1 << i) + (j >> i) << i
                if num not in s and num not in seen:
                    seen.add(num)
                    break
            else:
                return 1 << i
